 * Decodes HTML entities in a given HTML string.
 * @param {string} htmlString - The HTML string containing entities to decode.
 * @returns {string} The decoded string with HTML entities converted back to their original characters.
 */
function replaceHtmlEntities(htmlString) {
  // Create a regex to match HTML entities
  const regex = /\&([\w-]+)/g;

  // Iterate through each entity found in the HTML string
  const entities = htmlString.replace(regex, (match) => {
    // Check if the entity is an attribute name
    if (match.match(/[\w-]+/g) && match[0] === '&') {
      // If it is, extract the attribute name
      const attributeName = match.slice(1);

      // Check if the attribute name contains any non-alphanumeric characters
      if (attributeName.match(/[\w.-]+/g)) {
        // If it does, remove any leading or trailing whitespace
        attributeName = attributeName.replace(/\s+/g, '');

        // Add the attribute value to the result
        return `${attributeName}${match[1]}`;
      }
    }

    // If the entity is not an attribute name, it is an element name
    if (match.match(/[\w-]+/g) && match[0] === '&') {
      // If it is, extract the element name
      const elementName = match.slice(1);

      // Check if the element name contains any non-alphanumeric characters
      if (elementName.match(/[\w.-]+/g)) {
        // If it does, remove any leading or trailing whitespace
        elementName = elementName.replace(/\s+/g, '');

        // Add the element value to the result
        return `${elementName}${match[1]}`;
      }
    }

    // If the entity is not an attribute name or element name, it is an entity reference
    return match;
  });

  // Return the decoded string with HTML entities converted back to their original characters
  return entities.replace(/\&/g, '&amp;');
}
"}]

