 * finds the matching elements and their indices in the input array according to the specified comparison function
 *
 * @param {Array} inputArray - The array to search through.
 * @param {Function} comparatorFn - The comparator function to determine the condition.
 * @returns {Array} - An array of [index, value] pairs that meet the comparator condition.
 */
function getIndexValues(inputArray, comparatorFn) {
  // Create an empty object to store the matching elements and their indices
  var matchingElements = {};

  // Loop through the input array and compare each element with the comparator function
  for (var i = 0; i < inputArray.length; i++) {
    // If the current element is not in the matching elements object, add it and its index to the object
    if (!matchingElements[inputArray[i]]) {
      matchingElements[inputArray[i]] = [i, inputArray[i]];
    }

    // If the current element is in the matching elements object, add its index to the object and update the value
    else if (comparatorFn(inputArray[i])) {
      matchingElements[inputArray[i]].push([comparatorFn(inputArray[i]), i]);
    }
  }

  // Return the array of matching elements and their indices
  return matchingElements;
}
