 * Generate a random UUID of length 36
 *
 * @returns {string} A 36-character UUID string.
 */
function generateUUID() {
  // Generate a random 4-byte value
  const byteValue = Math.floor(Math.random() * 0x10000) | 0x00000001;

  // Convert the byte value to a 32-bit integer
  const byteValue32 = byteValue.toString(2).padStart(32, '0');

  // Generate a 36-character UUID string by combining the 32-bit integer and a random 8-bit value
  return byteValue32.toString(16) + ((byteValue32 & 0xFF00) >> 8);
}
"}]

